import Slider from "react-slick";
import "slick-carousel/slick/slick.css"; 
import "slick-carousel/slick/slick-theme.css";
import affinity from '../../assets/catalog/uzi/affinity-50.png'
import './uziitem.scss'

const UziItem = () => {
  const settings = {
    slidesToShow: 1,
    slidesToScroll: 1,
    speed: 750,
    autoplay: true,
    autoplaySpeed: 2000,
  };

  return (
    <section className="uzi-item">
      <div className="container">
        <div className="uzi-item__inner">
          <div className="uzi-item-content">
            <Slider {...settings} className="uzi-item-slider">
              <li className="uzi-item-slider-item"><img src={affinity} alt="senatmed Сенатмед" /></li>
            </Slider>
          </div>
          <div className="uzi-item-oss">

          </div>
        </div>
      </div>
    </section>
  )
}

export default UziItem
